import React from "react";
import "./index.css"
import IfSlotM from './IfSlotM';

const SlotM=(props)=>{
    let {x,y,z}=props;

    if(x===y && y===z){
        return <IfSlotM x={x} y={y} z={z}/>
    }else{
        return <>
            <div className="slot_inner">
                <h1>{x} {y} {z}</h1>
                <h1>This is not matching</h1>
                <hr/>
            </div>
        </>
    }
}
export default SlotM;
